import React from 'react';
import Admin from "./pages/Admin/Admin";
import Shop from "./pages/Shop/Shop";
import {Route, Routes} from "react-router-dom";

const App = () => {
    return (
        // <div>
        //     <Admin/>
        //     <Shop/>
        // </div>
        <>
            <Routes>
                <Route path="/" element={<></>}>
                    <Route path="invoices" element={<Admin />} />
                    <Route path="dashboard" element={<Shop />} />
                </Route>
            </Routes>
        </>
    );
};

export default App;
